// Increment the retry counter (property "RetryCountWhileWaitingForMessageAvailability")  
def countOfRetriesWhileWaitingForMessage = testRunner.testCase.getPropertyValue("RetryCountWhileWaitingForMessageAvailability")
countOfRetriesWhileWaitingForMessage = Integer.parseInt(countOfRetriesWhileWaitingForMessage) + 1
testRunner.testCase.setPropertyValue("RetryCountWhileWaitingForMessageAvailability", countOfRetriesWhileWaitingForMessage.toString())

// Check if the maximal number of retries is reached
def maxRetryCount = 100//consider for 25 minutes
//log.info countOfRetriesWhileWaitingForMessage
assert countOfRetriesWhileWaitingForMessage <= maxRetryCount : "Retries while waiting for message availability exceeded max retry count"

